import React from 'react';
import Mapa from "../../Utils/Img/Localidad/mapa.png";



function Cajamapa() {
	return (
	 
	
		 
	   
		<div className="Contenidolocalidad">
  
  
		<img id="imglocalidad" src={Mapa} alt=""/>
		<map id="imglocalidad" name="imagemap1">
  <area shape="rect" alt="Ohren" coords="560,68,756,144" href="#map__item1" />
  <area shape="rect" alt="Augen" coords="28,200,244,276" href="#map__item2" />
  <area shape="rect" alt="Barthaar" coords="485,445,760,520" href="#map__item3" />
</map>
	  
		</div>
	  
		
			
	  
	  
  
	 
	);
  }
  
  export default Cajamapa;
